-- Script para importar empresas desde CSV a la tabla companies
-- Basado en: MTZ Ouroborus AI - Hoja 1.csv

-- Primero, limpiar datos existentes (opcional - comentar si no quieres borrar)
-- DELETE FROM public.companies;

-- Insertar empresas desde el CSV
-- Mapeo: RAZON SOCIAL -> company_name, RUT USUARIO -> rut, CLAVE SII -> clave_impuestos

ON CONFLICT (rut) DO UPDATE SET
  company_name = EXCLUDED.company_name,
  clave_impuestos = COALESCE(EXCLUDED.clave_impuestos, companies.clave_impuestos),
  metadata = EXCLUDED.metadata,
  updated_at = now();

-- Verificar importación
SELECT COUNT(*) as total_empresas FROM public.companies;

